import React from "react";
import "./profile.css"; // Import the provided CSS
import avatar from "./img/fin.jpg";

const OurServices = () => {
  return (
    <div className="container">

      <div className="grid-container">
        <div className="profile">
          <h3>About Us</h3>
          <p>
            Farm to plate is an organization that enables farmers to display
            their products and facilities. Instead of being dependent on the
            complex supply chain, farmers can sell their fresh products to the
            local customers. While empowering the farmers, we ensure that the
            local people are getting healthy and fresh produces from their
            nearest farms.
          </p>
        </div>
        <div className="profile">
          <img className="avatar" src={avatar} alt="Avatar" />
        </div>
      </div>
    </div>
  );
};

export default OurServices;
